import React from 'react';
import Skeleton from 'react-loading-skeleton';

// Components
import PlusCard from './PlusCard';

// Images
import img1 from '../../public/img/plus-1.jpg';

export default () => {
  img1 ? <PlusCard img={img1} /> : console.log('loading');
};
